import NavHeader from './componenents/navHeader';
import Cards from './componenents/cards';
import Carousel from './componenents/carousel';
import Promo from './componenents/promo/promo';
import Fliper from './componenents/fliped';
function App() {
  return (
    <div className="App">
      <Promo />
      <NavHeader />
      <Cards />
      <Carousel />
       <Fliper/>   </div>
  );
}

export default App;
